import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { GenerateLetterComponent } from '../generate-letter/generate-letter.component';
import { QueryGeneratedLettersComponent } from '../query-generated-letters/query-generated-letters.component';

const deductionRoutes: Routes = [
  {
    path: 'generate-letter',
    component: GenerateLetterComponent,
    data: {
      pageTitle: 'nspay2App.letter.generate.home.title',
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'query-letters',
    component: QueryGeneratedLettersComponent,
    data: {
      pageTitle: 'nspay2App.letter.query.home.title',
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule]
})

export class LetterRoutingModule { }
